style.css:
@-moz-document domain("google.com") {
/* General Background */
  body {
    background-color: #c4caca;
    color: #000000;
  }

  /* Google Search Bar */
  input[type="text"] {
    background-color: #ffffff;
    color: #000000;
    border: 1px solid #888888;
  }

  /* Google Logo - Pixelated */
  img[alt="Google"] {
    image-rendering: pixelated;
    filter: none; /* Disable default image filters */
  }

  /* Search Results */
  .g {
    background-color: #eaeaea;
    color: #000000;
  }

  /* Links */
  a {
    color: #1a73e8;
  }

  /* Footer */
  footer {
    background-color: #b0b0b0;
    color: #000000;
  }
}
